.',1),(11,1,31,1,1,'0','Ok','2014-01-07 12:04:11','2014-01-27 12:04:11','Messagerie instantane','Les logiciels offrant une communication textuelle, en direct, entre deux parties ou plus.',1),(12,1,31,1,1,'0','Ok','2014-01-07 12:04:12','2014-01-27 12:04:12','Navigateurs Web','Les logiciels permettant de visualiser des pages Web.',1),(13,1,31,1,1,'0','Ok','2014-01-07 12:04:13','2014-01-27 12:04:13','Transfert de fichiers','Les logiciels permettant de transfrer des fichiers d\'une machine  une autre  l\'aide de divers protocoles (FTP, SFTP, etc.).',1),(14,1,31,1,1,'0','Ok','2014-01-07 12:04:14','2014-01-27 12:04:14','Voix sur IP','Les logiciels offrant un service de tlphonie par Internet.',1),(15,1,31,1,1,'0','Ok','2014-01-07 12:04:15','2014-01-27 12:04:15','Jeux','Les logiciels pour divertissement.',1),(16,1,31,1,1,'0','Ok','2014-01-07 12:04:16','2014-01-27 12:04:16','Logiciels ducatifs','Les logiciels ayant comme but de former et d\'instruire.',1),(17,1,31,1,1,'0','Ok','2014-01-07 12:04:17','2014-01-27 12:04:17','Multimdia ','Les logiciels servant  la consultation ou  la production de contenu multimdia audio et vido.',1),(18,1,31,1,1,'0','Ok','2014-01-07 12:04:18','2014-01-27 12:04:18','Outils d\'administration systme','Les logiciels facilitant l\'administration du poste de travail.',1),(19,1,31,1,1,'0','Ok','2014-01-07 12:04:19','2014-01-27 12:04:19','Publication assiste par ordinateur ','Les logiciels utiliss pour prparer la production de documents destins  l\'impression (mise en page, gnration de PDF).',1),(20,1,31,1,1,'0','Ok','2014-01-07 12:04:20','2014-01-27 12:04:20','Utilitaires','Les logiciels offrant divers services utiles comme la compression de fichiers, la capture dcrans, Etc.',1),(21,1,31,1,1,'0','Ok','2014-01-07 12:04:21','2014-01-27 12:04:21','Virtualisation','Les logiciels permettant l\'excution d\'un systme d\'exploitation tiers, par exemple l\'excution d\'un systme Windows sous Linux.',1),(22,1,31,1,1,'0','Ok','2014-01-07 12:04:22','2014-01-27 12:04:22','Gestion de grappes (clustering)','Les outils permettant la gestion de grappes de calculs. ',1),(23,1,31,1,1,'0','Ok','2014-01-07 12:04:23','2014-01-27 12:04:23','Gestion de listes de diffusion','Les outils permettant la cration, l\'administration et l\'envoi de courriels de listes de diffusion.',1),(24,1,31,1,1,'0','Ok','2014-01-07 12:04:24','2014-01-27 12:04:24','Gestion de parc','Les outils facilitant l\'inventaire, le contrle des postes et l\'administration distante automatise d\'un parc informatique. ',1),(25,1,31,1,1,'0','Ok','2014-01-07 12:04:25','2014-01-27 12:04:25','Gestion de processus d\'affaires','Lensemble des logiciels permettant la modlisation des processus mtiers d\'une entreprise puis leur excution concrte en interaction avec les diffrents systmes d\'information de l\'organisation.',1),(26,1,31,1,1,'0','Ok','2014-01-07 12:04:26','2014-01-27 12:04:26','Gestion lectronique des documents','Les systmes facilitant la gestion du cycle de vie des documents lectroniques.',1),(27,1,31,1,1,'0','Ok','2014-01-07 12:04:27','2014-01-27 12:04:27','Moteurs de recherche','Les logiciels offrant une fonction d\'indexation et de recherche dans les bases de donnes, les fichiers et les autres sources d\'information, et offrant habituellement une interface Web  l\'utilisateur permettant la saisie de mots-cls et de critres de recherche.',1),(28,1,31,1,1,'0','Ok','2014-01-07 12:04:28','2014-01-27 12:04:28','Outils de haute disponibilit','Les logiciels permettant  un ensemble de machines de fournir un service commun avec un haut taux de disponibilit. ',1),(29,1,31,1,1,'0','Ok','2014-01-07 12:04:29','2014-01-27 12:04:29','Outils de surveillance (monitoring)','Les logiciels permettant de surveiller l\'tat des serveurs et de l\'infrastructure informatique d\'une organisation.',1),(30,1,31,1,1,'0','Ok','2014-01-07 12:04:30','2014-01-27 12:04:30','Plateformes de virtualisation','Les logiciels permettant l\'excution simultane de plusieurs systmes d\'exploitation indpendants