s d\'annuaire','Les services centraliss qui regroupent de l\'information sur les utilisateurs, permettant ainsi  diverses applications de rpertorier et de vrifier certaines informations (courriel, nom, nom d\'utilisateur, mot de passe, etc.). Les services dannuaire sont galement utiliss ',1),(39,1,31,1,1,'0','Ok','2014-01-07 12:04:39','2014-01-27 12:04:39','Services d\'authentification unique','Les logiciels permettant  un utilisateur de s\'authentifier une seule fois sur le rseau et d\'accder  un ensemble d\'applications htrognes sans avoir besoin de s\'authentifier  nouveau.',1),(40,1,31,1,1,'0','Ok','2014-01-07 12:04:40','2014-01-27 12:04:40','Services rseau partags essentiels','Services de gestion du rseau, comme les serveurs de rsolution de nom (DNS), les serveurs DHCP et les serveurs mandataires (proxy).',1),(41,1,31,1,1,'0','Ok','2014-01-07 12:04:41','2014-01-27 12:04:41','Services rseau partags connexes','Les autres services rseau partags connexes, comme les serveurs d\'impression, de messagerie instantane et autres.',1),(42,1,31,1,1,'0','Ok','2014-01-07 12:04:42','2014-01-27 12:04:42','Serveurs dapplications','Les cadres applicatifs permettant la mise en commun de services ddis  l\'excution d\'applications serveur.',1),(43,1,31,1,1,'0','Ok','2014-01-07 12:04:43','2014-01-27 12:04:43','Serveurs de collecticiel','Les logiciels permettant le travail collaboratif, ct serveur. Il est  noter qu\'un grand nombre de fonctions de ces serveurs peuvent tre assures par d\'autres catgories de logiciels (serveurs de courriels, serveurs de fichiers, gestionnaires de contenu, etc.).',1),(44,1,31,1,1,'0','Ok','2014-01-07 12:04:44','2014-01-27 12:04:44','Serveurs de courriels','Les serveurs permettant la rception et la livraison de courriels (SMTP), ainsi que l\'accs aux courriels (IMAP-IMAPs, POP3- POP3s).',1),(45,1,31,1,1,'0','Ok','2014-01-07 12:04:45','2014-01-27 12:04:45','Serveurs de fichiers','Les serveurs permettant  un ensemble d\'utilisateurs d\'accder  des fichiers communs via diffrents protocoles (protocole FTP, NFS, SMB, etc.).',1),(46,1,31,1,1,'0','Ok','2014-01-07 12:04:46','2014-01-27 12:04:46','Serveurs de rseaux privs virtuels (RPV)','Les serveurs offrant la possibilit de relier une machine distante au rseau local d\'une organisation via un tunnel scuris dans l\'Internet (en anglais, VPN).',1),(47,1,31,1,1,'0','Ok','2014-01-07 12:04:47','2014-01-27 12:04:47','Serveurs de tlphonie IP','Les systmes offrant des services de voix sur IP.',1),(48,1,31,1,1,'0','Ok','2014-01-07 12:04:48','2014-01-27 12:04:48','Serveurs Web','Les serveurs fournissant des documents accessibles via un navigateur Web.',1),(49,1,31,1,1,'0','Ok','2014-01-07 12:04:49','2014-01-27 12:04:49','Solutions de formation en ligne','Les logiciels Web regroupant la documentation pertinente et diffrentes fonctions pour appuyer les cours dispenss en personne ou de faon virtuelle.',1),(50,1,31,1,1,'0','Ok','2014-01-07 12:04:50','2014-01-27 12:04:50','Systmes d\'information gographique','Les systmes permettant le traitement, l\'affichage et l\'impression de cartes et de donnes gographiques.',1),(51,1,31,1,1,'0','Ok','2014-01-07 12:04:51','2014-01-27 12:04:51','Systmes de gestion de bases de donnes','Les systmes de stockage de donnes optimiss pour conserver des informations volumineuses variant frquemment.',1),(52,1,31,1,1,'0','Ok','2014-01-07 12:04:52','2014-01-27 12:04:52','Systmes de gestion de contenu','Les systmes permettant  plusieurs individus de travailler sur un contenu commun dans le but ventuel de le publier sur Internet.',1),(53,1,31,1,1,'0','Ok','2014-01-07 12:04:53','2014-01-27 12:04:53','Systmes de sauvegarde','Les systmes de stockage de donnes optimiss pour conserver des informations volumineuses variant frquemment.',1),(54,1,31,1,1,'0','Ok','2014-01-07 12:04:54','2014-01-27 12:04:54','Systmes de suivi des requtes','Les systmes grant la liste des requtes d\'une organisation et permettant le suivi du cycle de vie de ces requtes. Les bogues peuvent tre considrs comme un cas particulier de requtes.',1),(55,1,31,1,1,'0','Ok','2014-01-07 12:04:55','2014-01-27 12:04:55','Wikis','Les systmes de gestion du contenu collaboratif o tous les utilisateurs peuvent contribuer  la rdaction du contenu.',1),(56,1,31,1,1,'0','Ok','2014-01-07 12:04:56','2014-01-27 12:04:56','Bibliothques de codes (libraries)','Ensemble de fonctions et de classes regroupes, par thmes ou par fonctionnalit, et offrant des services partags  d\'autres programmes.',1),(57,1,31,1,1,'0','Ok','2014-01-07 12:04:57','2014-01-27 12:04:57','Cadres d\'applications (frameworks)','Groupes constitus de bibliothques de codes offrant  un programmeur la possibilit de dvelopper rapidement une application de manire aise.',1),(58,1,31,1,1,'0','Ok','2014-01-07 12:04:58','2014-01-27 12:04:58','Compilateurs','Les outils transformant les instructions de haut niveau d\'un langage de programmation donn en instructions binaires comprhensibles par un processeur.',1),(59,1,31,1,1,'0','Ok','2014-01-07 12:04:59','2014-01-27 12:04:59','Dbogueurs','Les outils permettant de faire la trace de l\'excution d\'un programme dans le but d\'en trouver les bogues.',1),(60,1,31,1,1,'0','Ok','2014-01-07 12:05:00','2014-01-27 12:05:00','diteurs','Les logiciels permettant l\'dition de documents textes et de programmes sans mise en forme.',1),(61,1,31,1,1,'0','Ok','2014-01-07 12:05:01','2014-01-27 12:05:01','Environnements intgrs de dveloppement','Les logiciels intgrant un diteur volu et spcialis pour la programmation, un dbogueur, des outils de tests, et d\'autres outils spcifiques au domaine.',1),(62,1,31,1,1,'0','Ok','2014-01-07 12:05:02','2014-01-27 12:05:02','Interprteurs et langages de script','Les logiciels permettant l\'excution de programmes crits dans un langage de haut niveau.',1),(63,1,31,1,1,'0','Ok','2014-01-07 12:05:03','2014-01-27 12:05:03','Outils de modlisation','Les outils facilitant la conception et la reproduction de schmas modlisant un logiciel.',1),(64,1,31,1,1,'0','Ok','2014-01-07 12:05:04','2014-01-27 12:05:04','Systme de gestion de versions','Les systmes conservant sur un serveur central le code source de programmes et permettant le versionnement et le suivi des changements de ce code.',1),(65,1,31,1,1,'0','Ok','2014-01-07 12:05:05','2014-01-27 12:05:05','Systme de gestion des anomalies','Le logiciel grant la liste des bogues et des requtes associs au dveloppement d\'un logiciel et permettant le suivi du cycle de vie de ces requtes.',1),(71,5,31,5,5,'0','Ok','2014-01-30 11:58:11','2014-01-30 11:58:11','Logiciel prt  l\'emploi','Les logiciels autoportants qui ne ncessitent pas de service professionnel et peuvent tre utiliss par le grand public sans difficult.',3),(72,5,31,5,5,'0','Ok','2014-01-30 11:58:29','2014-01-30 11:58:29','Logiciel intermdiaire','Les logiciels qui pourraient tre adopts avec un support de communaut ou avec un support professionnel indpendant. Ces logiciels peuvent tre dtachs du service (on choisit le logiciel pour adoption et tout fournisseur peut assurer le service).',3),(73,5,31,5,5,'0','Ok','2014-01-30 11:58:46','2014-01-30 11:58:46','Logiciel lourd','Les logiciels qui ncessitent un support professionnel et qu\'il faut adopter avec service (exemples : progiciel de gestion intgre, dossier de sant).',3),(74,5,31,5,5,'0',NULL,'2014-02-11 10:03:00','2014-02-11 10:03:00','Antivirus','',2),(75,5,31,5,5,'0',NULL,'2014-02-11 10:03:49','2014-02-11 10:03:49','Apprentissage en ligne','',2),(76,5,31,5,5,'0',NULL,'2014-02-11 10:04:02','2014-02-11 10:04:02','Archivage','',2),(77,5,31,5,5,'0',NULL,'2014-02-11 10:04:18','2014-02-11 10:04:18','Authentification unique - SSO','',2),(78,5,31,5,5,'0',NULL,'2014-02-11 10:04:33','2014-02-11 10:04:33','Base de donnes','',2),(79,5,31,5,5,'0',NULL,'2014-02-11 10:04:48','2014-02-11 10:04:48','BI','',2),(80,5,31,5,5,'0',NULL,'2014-02-11 10:05:06','2014-02-11 10:05:06','Clients lgers','',2),(81,5,31,5,5,'0',NULL,'2014-02-11 10:05:28','2014-02-11 10:05:28','CMS','Un systme de gestion de contenu ou SGC (Content Management System ou CMS) est une famille de logiciels destins  la conception et  la mise  jour dynamique de sites Web ou d\'applications multimdia. Lorsque le SGC gre du contenu dynamique, on parle de systme de gestion de contenu dynamique ou SGCD (Dynamic Content Management System ou DCMS). Les SGC ne doivent pas tre confondus avec les systmes de gestion lectronique des documents (GED) qui permettent de raliser la gestion de contenu dans l\'entreprise.',2),(82,5,31,5,5,'0',NULL,'2014-02-11 10:05:53','2014-02-11 10:05:53','CRM','La gestion de la relation client (GRC), connue aussi sous son nom franais correct de gestion des relations avec les clients (GRC), et sous sa traduction anglaise Customer Relationship Management (CRM), est dfinie comme suit par le CXP Centre d\'eXpertise des Progiciels), cit par Jean-Louis Tomas :  La GRC est l\'ensemble des outils et techniques destins  capter, traiter, analyser les informations relatives aux clients et aux prospects, dans le but de les fidliser en leur offrant le meilleur service.   En termes d\'applications informatiques, il s\'agit des progiciels qui permettent de traiter directement avec le client, que ce soit au niveau de la vente, du marketing ou du service, et que l\'on regroupe souvent sous le terme de \"front-office\", ceci par opposition aux outils de \"back-office\" que sont les progiciels de gestion intgrs (ou ERP). ',2),(83,5,31,5,5,'0',NULL,'2014-02-11 10:06:18','2014-02-11 10:06:18','ECM','La gestion de contenu (en anglais Enterprise Content Management : ECM) vise  grer l\'ensemble des contenus d\'une organisation. Il s\'agit de prendre en compte sous forme lectronique les informations qui ne sont pas structures, comme les documents lectroniques, par opposition  celles dj structures dans les bases de donnes.  titre d\'exemple, une application de gestion de contenu servira  grer l\'ensemble des informations d\'un dossier client : courriers papier, courriels, tlcopie, contrats, etc., dans une mme infrastructure.',2),(84,5,31,5,5,'0',NULL,'2014-02-11 10:06:31','2014-02-11 10:06:31','Environnement de dveloppement intgr','',2),(85,5,31,5,5,'0',NULL,'2014-02-11 10:06:45','2014-02-11 10:06:45','Gomatique et SIG','',2),(86,5,31,5,5,'0',NULL,'2014-02-11 10:07:01','2014-02-11 10:07:01','Gestion de cls publiques','',2),(87,5,31,5,5,'0',NULL,'2014-02-11 10:07:21','2014-02-11 10:07:21','Logiciel de comptabilit','',2),(88,5,31,5,5,'0',NULL,'2014-02-11 10:07:34','2014-02-11 10:07:34','Logiciel de sauvegarde','',2),(89,5,31,5,5,'0',NULL,'2014-02-11 10:07:49','2014-02-11 10:07:49','Logiciel de synchronisation mobile','',2),(90,5,31,5,5,'0',NULL,'2014-02-11 10:08:02','2014-02-11 10:08:02','Moteur de recherche','',2),(91,5,31,5,5,'0',NULL,'2014-02-11 10:08:23','2014-02-11 10:08:23','PABX','Dans l\'industrie des tlcommunications, on dsigne par PABX IP (PBX IP ou encore IPBX) un autocommutateur tlphonique priv utilisant le protocole internet (IP) pour grer les appels tlphoniques d\'une entreprise, en interne sur son rseau local (LAN). Coupl  des technologies de voix sur IP, les communications tlphoniques pourront tre achemines sur le rseau tendu (WAN) de l\'entreprise. On utilise en gnral le terme  PABX IP  lorsque l\'on cherche  distinguer un systme de tlphonie sur IP des systmes de tlphonie  commutation de circuits numriques traditionnels (PABX). Le PABX IP est l\'volution vers l\'IP du PABX traditionnel. Autrement, On parle simplement de PABX.',2),(92,5,31,5,5,'0',NULL,'2014-02-11 10:08:38','2014-02-11 10:08:38','Progiciel de gestion intgr','',2),(93,5,31,5,5,'0',NULL,'2014-02-11 10:08:51','2014-02-11 10:08:51','Serveur mail','',2),(94,5,31,5,5,'0',NULL,'2014-02-11 10:09:07','2014-02-11 10:09:07','SGIB','',2),(95,5,31,5,5,'0',NULL,'2014-02-11 10:09:24','2014-02-11 10:09:24','Signature lectronique','',2),(96,5,31,5,5,'0',NULL,'2014-02-11 10:09:39','2014-02-11 10:09:39','Suite collaborative','',2),(97,5,31,5,5,'0',NULL,'2014-02-11 10:09:50','2014-02-11 10:09:50','Suite d\'dition','',2),(98,5,31,5,5,'0',NULL,'2014-02-11 10:10:05','2014-02-11 10:10:05','Surveillance rseau/systme','',2),(99,5,31,5,5,'0',NULL,'2014-02-11 10:10:18','2014-02-11 10:10:18','Systme d\'exploitation','',2),(100,5,31,5,5,'0',NULL,'2014-02-11 10:10:31','2014-02-11 10:10:31','Wiki','',2);
