ion-usage\": \"Usage en mode test\", \"date-fin-usage\": \"\", \"version-logiciel-utilisee\": \"2.3.1\", \"log-utilise_id\": 360, \"date-debut-usage\": \"2013-08-05\"}'),(543,50,15,50,50,'0',NULL,'2013-08-09 14:13:10','2013-08-09 14:13:10',211,'{\"nom-logiciel\": \"Drupal\", \"uri-site-communaute-gouv\": \"\", \"uri-du-forum\": \"http://drupalfr.org/forum ou https://drupal.org/forum\", \"fourche-logiciel_id\": null, \"taille-logiciel\": \"Installation minimum 15 Mo ; une site web avec plusieurs modules et th\\u00e8mes 60 Mo. Plus espace pour les fichiers t\\u00e9l\\u00e9charg\\u00e9s par les utilisateurs, m\\u00e9dia, sauvegarde, etc.\", \"tecnologies-requises\": \"\", \"format-paquetage\": \" \", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"http://drupalfr.org/ ou https://drupal.org/download\", \"materiel-necessaire-installation\": \"\", \"description-logiciel\": \"Drupal est un syst\\u00e8me de gestion de contenu, c\'est-\\u00e0-dire un logiciel qui permet de g\\u00e9rer le contenu d\'un site Web. Ceci permet aux utilisateurs de faire \\u00e9voluer le site sans recourir syst\\u00e9matiquement \\u00e0 un programmeur.\\nDrupal est un outil qui s\\u2019adresse \\u00e0 la fois \\u00e0 des d\\u00e9butants ou des programmeurs experts. Sa flexibilit\\u00e9 lui permet de r\\u00e9pondre \\u00e0 la tr\\u00e8s grande majorit\\u00e9 des besoins du march\\u00e9: sites institutionnels, blog, annuaire, communautaire, marchand ou intranets, tout est possible.\\nL\'ensemble est constitu\\u00e9 de modules gravitant autour d\'un noyau tr\\u00e8s l\\u00e9ger. Chaque module est en quelque sorte une biblioth\\u00e8que de fonctions qui enrichit l\\u2019application et augmente ses possibilit\\u00e9s.\", \"uri-site-internet-logiciel\": \"http://drupalfr.org/ ou https://drupal.org/\", \"id-logiciel\": \"drupal\", \"fourche-logiciel\": \"\"}'),(544,50,15,50,50,'0',NULL,'2013-08-08 14:07:51','2013-08-08 14:07:51',212,'{\"nom-langage\": \"PHP\", \"id-langage\": \"php\