LL,'2013-10-03 14:17:08','2013-10-03 14:17:08',211,'{\"nom-logiciel\": \"Red Hat JBoss Enterprise Application Platform\", \"uri-du-forum\": \"https://community.jboss.org/en/jbosseap\", \"fourche-logiciel_id\": null, \"taille-logiciel\": \"\", \"format-paquetage\": \" \", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"https://www.jboss.org/products/eap.html\", \"uri-site-communaute-gouv\": \"\", \"description-logiciel\": \"Red Hat JBoss Enterprise Application Platform includes everything you \\nneed to build, run and manage Java-based services.&nbsp; It is ideal for a \\nwide range of applications from HTML5 mobile applications to highly \\ntransactional applications that utilize the Java\\u2122 Enterprise Edition \\n(EE) programming approach. JBoss Enterprise Application Platform, a \\nfully certified Java EE6 container, leverages the JBoss Application \\nServer and adds enterprise features for clustering, caching, messaging, \\ntransactions and a full web services stack.\", \"uri-site-internet-logiciel\": \"https://www.jboss.org/products/eap.html\", \"fourche-logiciel\": \"\", \"id-logiciel\": \"jbossappplat\"}'),(596,50,15,50,5,'0',NULL,'2013-10-03 14:41:35','2013-10-03 14:41:35',211,'{\"nom-logiciel\": \"Jetty\", \"uri-du-forum\": \"http://www.eclipse.org/jetty/documentation/current/community.html#community-mailing-lists\", \"fourche-logiciel_id\": null, \"taille-logiciel\": \"\", \"format-paquetage\": \".tgz\", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"http://www.eclipse.org/jetty/downloads.php\", \"uri-site-communaute-gouv\": \"\", \"description-logiciel\": \"The <a href=\\\"http://eclipse.org/jetty\\\">Jetty Web Server</a> provides an HTTP server and Servlet container capable of\\n\\t  serving static and dynamic content either from a standalone or embedded instantiations.   From jetty-7 on, the jetty\\n\\t  webserver and other core compoments are hosted by the Eclipse Foundation. The project provides:<br><ul><li>Asynchronous HTTP Server</li><li>Standards based Servlet Container</li><li><a href=\\\"http://en.wikipedia.org/wiki/Web_Sockets\\\">Web Sockets</a> server</li><li><a href=\\\"http://en.wikipedia.org/wiki/SPDY\\\">SPDY</a> server</li><li>Asynchronous HTTP Client</li><li>OSGi, JNDI, JMX, JASPI, AJP support</li></ul><br>\", \"uri-site-internet-logiciel\": \"http://www.eclipse.org/jetty/\", \"fourche-logiciel\": \"\", \"id-logiciel\": \"jetty\"}'),(597,50,15,50,5,'0',NULL,'2013-10-03 14:57:01','2013-10-03 14:57:01',211,'{\"nom-logiciel\": \"Resin Application Server\", \"uri-du-forum\": \"http://forum.caucho.com/\", \"fourche-logiciel_id\": null, \"taille-logiciel\": \"\", \"format-paquetage\": \" \", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"http://www.caucho.com/download/\", \"uri-site-communaute-gouv\": \"\", \"description-logiciel\": \"\", \"uri-site-internet-logiciel\": \"http://www.caucho.com/resin-application-server-2/\", \"fourche-logiciel\": \"\", \"id-logiciel\": \"resinappser\"}'),(598,50,15,50,50,'0',NULL,'2013-08-12 13:34:15','2013-08-12 13:34:15',211,'{\"nom-logiciel\": \"JOnAS\", \"uri-site-communaute-gouv\": \"\", \"uri-du-forum\": \"http://jonas.ow2.org/xwiki/bin/view/Community/ContactUs\", \"fourche-logiciel_id\": null, \"taille-logiciel\": \"\", \"tecnologies-requises\": \"\", \"format-paquetage\": \" \", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"http://jonas.ow2.org/xwiki/bin/view/Main/Downloads\", \"materiel-necessaire-installation\": \"\", \"description-logiciel\": \"JOnAS is a leading edge Java EE 5 certified Open Source OSGi Enterprise Server developed by Bull and OW2. OSGi technology is a set of specifications that defines a dynamic component system for Java. These specifications reduce software complexity by providing a modular architecture for large-scale distributed systems as well as small, embedded applications. \", \"uri-site-internet-logiciel\": \"http://jonas.ow2.org/xwiki/bin/view/Main/WebHome\", \"id-logiciel\": \"jonas\", \"fourche-logiciel\": \"\"}'),(599,50,15,50,50,'0',NULL,'2013-08-12 14:38:28','2013-08-12 14:38:28',211,'{\"nom-logiciel\": \"Liferay Portal\", \"uri-site-communaute-gouv\": \"\", \"uri-du-forum\": \"https://www.liferay.com/fr/community/wiki/-/wiki/Main/FrontPage\", \"fourche-logiciel_id\": null, \"taille-logiciel\": \"\", \"tecnologies-requises\": \"\", \"format-paquetage\": \" \", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"https://www.liferay.com/fr/downloads/liferay-portal/available-releases\", \"materiel-necessaire-installation\": \"\", \"description-logiciel\": \"Liferay Portal est une plate-forme Web d\'entreprise pour cr\\u00e9er des solutions d\'affaires qui donnent des r\\u00e9sultats imm\\u00e9diats et \\u00e0 long terme de valeur. \\nLa version 6.1 de Liferay est sortie en version entreprise en 2012. Elle a simplifi\\u00e9 la gestion des communaut\\u00e9s et enrichi la gestion de contenu. La gestion documentaire a \\u00e9t\\u00e9 refondue et vient \\u00e0 pr\\u00e9sent avec un client \\u00e0 la \\u00ab Dropbox \\u00bb : Liferay Sync qui permet de synchroniser les documents distants avec un dossier local ou sur un mobile.\\nUne marketplace se voulant \\u00eatre un \\u00ab App Store \\u00bb pour les extensions Liferay a \\u00e9t\\u00e9 introduite en ao\\u00fbt 2012.\\nLa prochaine version, 6.2, est pr\\u00e9vue pour la fin 2013, et visera \\u00e0 faciliter la gestion des documents, rendre plus robuste la plateforme et fournir plus d\\u2019outils pour les versions mobiles.\", \"uri-site-internet-logiciel\": \"https://www.liferay.com/fr/products/liferay-portal/overview\", \"id-logiciel\": \"lliferay_portal\", \"fourche-logiciel\": \"\"}'),(600,50,15,50,50,'0',NULL,'2013-08-12 13:46:37','2013-08-12 13:46:37',216,'{\"logi-lic\": \"lliferay_portal\", \"lic-gerant_id\": 349, \"logi-lic_id\": 599, \"lic-gerant__info__nom-licence\": \"\", \"lic-gerant\": \"04\"}'),(601,50,15,50,50,'0',NULL,'20