taille-logiciel\": \"\", \"tecnologies-requises\": \"\", \"format-paquetage\": \" \", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"http://sourceforge.net/projects/intelligid/files/\", \"materiel-necessaire-installation\": \"\", \"description-logiciel\": \"Solution pour la gestion documentaire, \\n\\u2022 Conforme \\u00e0 toutes les normes d\\u00e9finies par le gouvernement du Qu\\u00e9bec en gestion int\\u00e9gr\\u00e9e des documents et enti\\u00e8rement align\\u00e9e sur les orientations de la loi 133, d\\u00e9pos\\u00e9e par la pr\\u00e9sidente du Conseil du Tr\\u00e9sor, sur la gestion des ressources informationnelles.\\n\\u2022 Conforme au cadre de r\\u00e9f\\u00e9rence gouvernemental en gestion int\\u00e9gr\\u00e9e des documents (CRGGID)\\n\\u2022 Impl\\u00e9mente le profil de m\\u00e9tadonn\\u00e9es gouvernemental, version 2.0\\n\\u2022 Conforme aux lois et r\\u00e8glements r\\u00e9gissant la gestion documentaire au gouvernement du Qu\\u00e9bec, principalement la Loi sur les Archives, L.R.Q., chapitre A-21.1;\\n\\u2022 Conforme \\u00e0 la loi sur l\'acc\\u00e8s aux documents des organismes publics et sur la protection des renseignements personnels, L.R.Q., chapitre A-2.1\\n\\u2022 Conforme \\u00e0 la loi concernant le cadre juridique des technologies de l\'information, L.R.Q., chapitre C-1.1 \\nIntelliGID g\\u00e8re le cycle de vie du document depuis sa cr\\u00e9ation, ce qui permet tr\\u00e8s rapidement d\\u2019\\u00e9purer un syst\\u00e8me et d\\u2019appliquer automatiquement les bonnes r\\u00e8gles de la GID sur le document.\\nCertaines solutions ne permettent pas de g\\u00e9rer le cycle de vie depuis la cr\\u00e9ation. Par exemple, Alfresco va disposer d\\u2019un espace archivistique et de plusieurs espaces de collaboration. Le cycle de vie est appliqu\\u00e9 uniquement sur l\\u2019espace archivistique. Ainsi, une personne qui travaille dans l\\u2019espace de collaboration Alfresco doit faire le m\\u00e9nage de ses documents et a l\\u2019obligation d\\u2019envoyer des documents \\u00e0 l\\u2019espace archivistique. Ce qui est tr\\u00e8s similaire au mode de fonctionnement archivistique papier.\\nIntelliGID, lors du passage de l\\u2019actif vers le semi-actif, s\\u2019assurera que l\\u2019utilisateur a bien identifi\\u00e9 une version finale de ses documents, convertira le document vers un format de conservation \\u00e0 long terme, supprimera toutes les versions de travail, etc.\\nG\\u00e9rer le cycle de vie depuis la cr\\u00e9ation du document assure \\u00e0 l\\u2019organisation de conserver les documents essentiels et diminue de mani\\u00e8re consid\\u00e9rable le temps consacr\\u00e9 \\u00e0 la gestion des documents.\", \"uri-site-internet-logiciel\": \"http://www.doculibre.com/content/intelligid-solution-open-source-pour-la-gestion-documentaire\", \"id-logiciel\": \"intelligid\", \"fourche-logiciel\": \"\"}'),(712,50,15,50,50,'0',NULL,'2013-08-15 13:48:16','2013-08-15 13:48:16',214,'{\"cate-logi\": \"pollo_30\", \"cate-logi__info__nom-categorie\": \"\", \"logi-cate_id\": 711, \"logi-cate\": \"intelligid\", \"cate-logi_id\": 655}'),(713,50,15,50,50,'0',NULL,'2013-08-15 14:16:23','2013-08-15 14:16:23',215,'{\"id-licence\": \"gpl3\", \"nom-licence\": \"Licence publique g\\u00e9n\\u00e9rale GNU version 3\", \"achronyme-licence\": \"GPLv3\", \"type-licence\": \"Logiciel libre\", \"uri-licence\": \"https://gnu.org/licenses/gpl-3.0.fr.html\"}'),(714,50,15,50,50,'0',NULL,'2013-08-15 14:16:34','2013-08-15 14:16:34',216,'{\"logi-lic\": \"intelligid\", \"lic-gerant_id\": 713, \"logi-lic_id\": 711, \"lic-gerant__info__nom-licence\": \"\", \"lic-gerant\": \"gpl3\"}'),(715,50,15,50,50,'0',NULL,'2013-10-17 14:40:03','2013-10-17 14:40:03',253,'{\"description-groupe\": \"Cat\\u00e9gorisation des logiciels telle qu\'elle est pr\\u00e9sent\\u00e9e en annexe B du document \\u00ab\\u00a0LOGICIELS LIBRES ET OUVERTS Guide d\'analyse de maturit\\u00e9\\u00a0\\u00bb (aussi connu sous le nom de \\u00ab\\u00a0Portef