e community of people around the world.\", \"nom-logiciel\": \"Drupal\", \"uri-site-logiciel\": \"https://drupal.org/\", \"recommande-gouv-quebec\": false, \"fourlogic_id\": null, \"uri-commu-gouv\": \"\", \"uri-site-alternatif\": \"\", \"fourlogic\": \"\"}'),(1210,5,31,5,5,'0',NULL,'2013-11-08 10:24:31','2013-11-08 10:24:31',278,'{\"nom-type-version\": \"Commnunautaire\"}'),(1211,5,31,5,5,'0',NULL,'2013-11-08 10:24:41','2013-11-08 10:24:41',278,'{\"nom-type-version\": \"Entreprise\"}'),(1212,5,31,5,5,'0',NULL,'2013-11-08 10:26:07','2013-11-08 10:26:07',312,'{\"type-de-version\": \"Commnunautaire\", \"log-typver\": \"Drupal\", \"derniere-version-connue-logiciel\": \"7.23\", \"log-typver_id\": 1209, \"log-typver__info__uri-site-logiciel\": \"\", \"log-typver__info__nom-logiciel\": \"\", \"type-de-version_id\": 1210}'),(1213,5,31,5,50,'0',NULL,'2013-11-14 11:52:04','2013-11-14 11:52:04',277,'{\"description\": \"The Apache HTTP Server is an open-source HTTP server for modern operating systems including UNIX, Microsoft Windows, Mac OS/X and Netware. The goal of this project is to provide a secure, efficient and extensible server that provides HTTP services observing the current HTTP standards. Apache has been the most popular web server on the Internet since April of 1996. \", \"nom-logiciel\": \"Apache HTTP Server\", \"uri-site-logiciel\": \"http://www.apache.org/\", \"recommande-gouv-quebec\": true, \"fourlogic_id\": null, \"uri-commu-gouv\": \"\", \"uri-site-alternatif\": \"\", \"fourlogic\": \"\"}'),(1214,5,31,5,5,'0',NULL,'2013-11-08 10:59:52','2013-11-08 10:59:52',312,'{\"type-de-version\": \"Commnunautaire\", \"type-de-version_id\": 1210, \"derniere-version-connue-logiciel\": \"2.4\", \"log-typver_id\": 1213, \"log-typver\": \"Apache HTTP Server\"}'),(1215,5,31,5,5,'0',NULL,'2013-11-08 11:00:11','2013-11-08 11:00:11',305,'{\"log-prere\": \"Apache HTTP Server\", \"log-prereq2_id\": 1209, \"log-prereq2\": \"Drupal\", \"log-prere_id\": 1213}'),(1216,5,31,5,5,'0',NULL,'2013-11-08 11:01:43','2013-11-08 11:01:43',277,'{\"description\": \"Nginx (pronounced engine-x) is a free, open-source, high-performance HTTP server and reverse proxy, as well as an IMAP/POP3 proxy server. Igor Sysoev started development of Nginx in 2002, with the first public release in 2004. Nginx now hosts nearly 12.18% (22.2M) of active sites across all domains. Nginx is known for its high performance, stability, rich feature set, simple configuration, and low resource consumption. \", \"nom-logiciel\": \"Nginx\", \"uri-site-logiciel\": \"http://wiki.nginx.org/Main\", \"recommande-gouv-quebec\": false, \"fourlogic_id\": \"\", \"uri-commu-gouv\": \"\", \"uri-site-alternatif\": \"\", \"fourlogic\": \"\"}'),(1217,5,31,5,5,'0',NULL,'2013-11-08 11:02:17','2013-11-08 11:02:17',312,'{\"type-de-version\": \"Commnunautaire\", \"type-de-version_id\": 1210, \"derniere-version-connue-logiciel\": \"1.4.0\", \"log-typver_id\": 1216, \"log-typver\": \"Nginx\"}'),(1218,5,31,5,5,'0',NULL,'2013-11-08 11:02:35','2013-11-08 11:02:35',305,'{\"log-prere\": \"Nginx\", \"log-prereq2_id\": 1209, \"log-prereq2\": \"Drupal\", \"log-prere_id\": 1216}'),(1219,5,31,5,5,'0',NULL,'2013-11-08 11:05:26','2013-11-08 11:05:26',277,'{\"description\": \"MySQL is the world\'s most popular open source database. Whether you are a fast growing web property, technology ISV or large enterprise, MySQL can cost-effectively help you deliver high performance, scalable database applications.\", \"nom-logiciel\": \"MySQL\", \"uri-site-logiciel\": \"http://www.mysql.com/\", \"recommande-gouv-quebec\": false, \"fourlogic_id\": \"\", \"uri-commu-gouv\": \"\", \"uri-site-alternatif\": \"\", \"fourlogic\": \"\"}'),(1220,5,31,5,5,'0',NULL,'2013-11-08 11:08:01','2013-11-08 11:08:01',312,'{\"type-de-version\": \"Commnunautaire\", \"type-de-version_id\": 1210, \"derniere-version-connue-logiciel\": \"5.6.14\", \"log-typver_id\": 1219, \"log-typver\": \"MySQL\"}'),(1221,5,31,5,5,'0',NULL,'2013-11-08 11:08:20','2013-11-08 11:08:20',305,'{\"log-prere\": \"MySQL\", \"log-prereq2_id\": 1209, \"log-prereq2\": \"Drupal\", \"log-prere_id\": 1219}'),(1222,5,31,5,5,'0',NULL,'2013-11-08 11:10:26','2013-11-08 11:10:26',277,'{\"description\": \"PostgreSQL is a powerful, open source object-relational database system. It has more than 15 years of active development and a proven architecture that has earned it a strong reputation for reliability, data integrity, and correctness. It runs on all major operating systems, including Linux, UNIX (AIX, BSD, HP-UX, SGI IRIX, Mac OS X, Solaris, Tru64), and Windows. It is fully ACID compliant, has full support for foreign keys, joins, views, triggers, and stored procedures (in multiple languages). It includes most SQL:2008 data types, including INTEGER, NUMERIC, BOOLEAN, CHAR, VARCHAR, DATE, INTERVAL, and TIMESTAMP. It also supports storage of binary large objects, including pictures, sounds, or video. It has native programming interfaces for C/C++, Java, .Net, Perl, Python, Ruby, Tcl, ODBC, among others, and exceptional documentation.\", \"nom-logiciel\": \"Postgresql\", \"uri-site-logiciel\": \"http://www.postgresql.org/\", \"recommande-gouv-quebec\": false, \"fourlogic_id\": \"\", \"uri-commu-gouv\": \"\", \"uri-site-alternatif\": \"\", \"fourlogic\": \"\"}'),(1223,5,31,5,5,'0',NULL,'2013-11-08 11:12:21','2013-11-08 11:12:21',312,'{\"type-de-version\": \"Commnunautaire\", \"type-de-version_id\": 1210, \"derniere-version-connue-logiciel\": \"9.3.1\", \"log-typver_id\": 1222, \"log-typver\": \"Postgresql\"}'),(1224,5,31,5,5,'0',NULL,'2013-11-08 11:12:38','2013-11-08 11:12:38',305,'{\"log-prere\": \"Postgresql\", \"log-prereq2_id\": 1209, \"log-prereq2\": \"Drupal\", \"log-prere_id\": 1222}'),(1225,5,31,5,5,'0',NULL,'2013-11-08 11:13:30','2013-11-08 11:13:30',277,'{\"description\": \"SQLite is a software library that implements a self-contained, serverless, zero-configuration, transactional SQL database engine.\", \"nom-logiciel\": \"SQLite\", \"uri-site